import React from 'react';
import styled from 'styled-components';
import { SearchOutlined } from '@mui/icons-material';
import Badge from '@mui/material/Badge';
import MailIcon from '@mui/icons-material/Mail';


const Container = styled.div`
    height: 60px;
`;

const Wrapper = styled.div`
    padding: 10px 20px;
    display: flex;
    justify-content: space-between;
    align-items: center;
`;

// Designing the Left side components of the Navbar
const Left = styled.div`
    flex: 1;  
    display: flex;  
    align-items: center;
`;

const Language = styled.div`
    font-size: 14px;
    cursor: pointer;
`;

const SearchContainer = styled.div`
    border: 0.5px solid lightgray;
    display: flex;
    align-items: center;
    margin-left: 25px;
    padding: 5px;
`;

const Input = styled.input`
    border: none;
`;

// Designing the Center side components of the Navbar
const Center = styled.div`
    flex: 1;   
    text-align: center; 
`;

const Logo = styled.h1`
    font-weight: bold;
`;

// Designing the Right side components of the Navbar
const Right = styled.div`
    flex: 1;    
`;

const MenuItem = styled.div`
    font-size: 14px;
    cursor: pointer;
`;



const Navbar = () => {
  return (

    <Container>
        <Wrapper>

            {/* Left side part of the Navbar */}
            <Left>
                <Language>EN</Language>
                <SearchContainer>
                    <Input /> 
                    <SearchOutlined />
                </SearchContainer>
            </Left>
            
            {/* Center part of the Navbar */}
            <Center>
                <Logo>LUXE.</Logo>
            </Center>

            {/* Right side part of the Navbar */}
            <Right>
                <MenuItem>REGISTER</MenuItem>
                <MenuItem>SIGN IN</MenuItem>
                <MenuItem>
                    
                </MenuItem>
            </Right>

        </Wrapper>
    </Container>
  )
}

export default Navbar
